import React from "react";
import './Home.css';
import bgimg from "../images/Scanner.png";
import { Button } from "react-bootstrap";

const Home = () => {
  return (
    <div className="home">
        <img
                    src={bgimg}
                    alt="Logo"
                    class="img-fluid"
                />
        <h1 class="text-center mt-30">The best solution for all your scanning needs!</h1>
        <Button>Get Started</Button>
    </div>
  );
};

export default Home;
